var QRCode = require('qrcode');
const express = require('express');
const app = express();


app.get('/', function (req, res) {
    res.send("Hello NodePay");
});

app.get('/api/qrcode', function(req, res) {
    var qp = req.query.text;
    var text = `upi://pay?pa=jaynil@jio&am=${qp}`;
    var opts = {
        errorCorrectionLevel: 'H',
        type: 'image/png',
        quality: 0.99,
        margin: 1
    }


    QRCode.toDataURL(text, opts, function (err, url) {
        if (err) throw err
        var html = `
        <!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Payouts at Node Pay</title>
    <style>
        h1{
            text-align: center;
        }
        div{
            display: flex;
            justify-content: center;
            align-items: center;
        }
        .qrimg{
            width: 150px;
            height: 150px;
        }

        .pgif{
            width: 200px;
            height: 150px;
        }
    </style>
</head>
<body>
    <h1>Scan QR code <br>&<br> Complete The payment.</h1>
    <div>
        <img class="qrimg"
            src="${url}">
    </div>
    <div><h2>Amount :&nbsp;<h1>â‚¹&nbsp;${qp} </h1></h2></div>
    <div>
        <img class="pgif" src="data:image/gif;base64,"
            alt="" />
    </div>
</body>
</html>`;

    res.send(html);
    })
});



const portN = process.env.PORT || port;
app.listen(portN, () => console.log(`Express on ${portN}`));